    server: "localhost",
    database: "MetalVos",
    options: {
        encrypt: true,
        trustServerCertificate: true
    }

}

export async function getConection() {
    try {
        const pool = await sql.connect(dbSettings);
        return pool;
    } catch (exeption) {
        console.log(exeption)
    }

}
